import React from 'react'

const TodosList = ({todos, setTodos}) => {
    return (
        <div>
            {todos.map((todo) => (
                <li 
                className = "list-item"
                key = {todo.id}>
                    <input 
                    type="text"
                    value = {todo.title}
                    onChange = {(e) => e.preventDefault()}
                    />
                <div>
                    <button>
                        Completed
                    </button>
                    <button>
                        Edit
                    </button>
                    <button>
                        Deleted
                    </button>
                </div>
                </li>
            )
            )}
        </div>
    )
}

export default TodosList;
